(function(){(function(){var $,appbar,burgerbutton,capitalize,closeMenu,main,mpEventName,navbar,socialLinks,toggleMenu;$=document.querySelector.bind(document);navbar=$(".navdrawer-container");appbar=$(".app-bar");burgerbutton=$(".menu");main=$("main");socialLinks=$(".social-items");closeMenu=function(){appbar.classList.remove("open");return navbar.classList.remove("open")};toggleMenu=function(){appbar.classList.toggle("open");return navbar.classList.toggle("open")};capitalize=function(string){return string.charAt(0).toUpperCase()+string.slice(1)};mpEventName=function(evt){return capitalizeFirstLetter(evt.target.href.split("#")[1])};main.addEventListener("click",closeMenu);burgerbutton.addEventListener("click",toggleMenu);navbar.addEventListener("click",function(event){if(event.target.nodeName==="A"||event.target.nodeName==="LI"){mixpanel.track("Click",{Section:mpEventName(event)});return closeMenu()}});return socialLinks.addEventListener("click",function(event){if(event.target.nodeName==="A"||event.target.nodeName==="I"){if(event.target.id==="email"){return mixpanel.track("Clicked on email")}else{return mixpanel.track("Socializing",{"Social profile":capitalizeFirstLetter(event.target.id)})}}})})()}).call(this);